   onGameStateChanged() {
       // noop
   }
   /** @inheritdoc */
   getSourceSelectSide() {
       return this.instrument.instrumentIndex === 2 ? 'right' : 'left';
   }
   /** @inheritdoc */
   onFlightStart() {
       // noop
   }
   /** @inheritdoc */
   onSoundEnd() {
       // noop
   }
